import React from 'react';
import RoseLogo from './rose-logo.png';

const SideNav = (props) => {
  return (
	  <div className="sidenav">
	    <img src={RoseLogo} className="rose-logo" alt="rose-logo" />
	    <a href="roverdata">
	    <img src={RoseLogo} className="rose-logo" alt="rose-logo" />
	    </a>
	    <a href="autonav">
	    <img src={RoseLogo} className="rose-logo" alt="rose-logo" />
	    </a>
	    <a href="payload">
	    <img src={RoseLogo} className="rose-logo" alt="rose-logo" />
	    </a>
	    <a href="arm">
	    <img src={RoseLogo} className="rose-logo" alt="rose-logo" />
	    </a>
	  </div>
  );
};

export default SideNav;
